import React from 'react'

const IterateArray = () => {

    const animals =['pato','loro','gato','perro']
    return (
        <>
            <ul>
                {animals.map(item=>(
                    <li>{item}</li>
                ))}
            </ul>
        </>
    )
}

export default IterateArray
